import React, { Component } from 'react';
import {Hero, HeroBody, HeroFooter, HeroHeader, Nav,
Container, Tabs, TabLink, Tab, Title, TabList} from 'bloomer';
import {Link} from 'react-router-dom';

export class Social extends Component {
    render() {
        return (
            <Hero isColor='info' isSize='medium'>
                <HeroHeader>
                </HeroHeader>

                <HeroBody>
                    <Container hasTextAlign='centered'>
                        <Title>Title</Title>
                    </Container>
                </HeroBody>

                <HeroFooter>
                    <Tabs isBoxed isFullWidth>
                        <Container>
                            <TabList>
                                <Tab><Link to="/selfcare" class='link'><TabLink>The Importance of Self Care</TabLink></Link></Tab>                                <Tab><Link to="/mental" class='link'><TabLink>Mental Wellbeing</TabLink></Link></Tab>
                                <Tab><Link to="/physical" class='link'><TabLink>Physical Wellbeing</TabLink></Link></Tab>
                                <Tab><Link to="/practical" class='link'><TabLink>Practical Self Care</TabLink></Link></Tab>
                                <Tab isActive><TabLink><Link to="/social" class='link'>Social Wellbeing</Link></TabLink></Tab>
                            </TabList>
                        </Container>
                    </Tabs>
                </HeroFooter>
                </Hero>
        );
    }
}

export default Social;
